import React, { Suspense } from "react";
import { Route, Switch } from "react-router-dom";
import Spinner from "../components/UI/Spinners/FormSpinner/FormSpinner";

const Landing = React.lazy(() => import("../components/Landing/Landing"));
const FullPost = React.lazy(() => import("../components/FullPost/FullPost"));
// const About = React.lazy(() => import("./About/About"));
// const Blog = React.lazy(() => import("./Blog/Blog"));
// const BlogPost = React.lazy(() => import("./Blog/BlogPost/BlogPost"));
// const Project = React.lazy(() => import("./Projects/Project/Project"));
// const Projects = React.lazy(() => import("./Projects/Projects"));
// const Contact = React.lazy(() => import("./Contact/Contact"));

const Cockpit = props => {
  let cockpitBody = (
    <Suspense fallback={<Spinner />}>
      <Switch>
        <Route path="/post/:id">
          <FullPost {...props} />} />
        </Route>
        <Route path="/post">
          <FullPost {...props} />} />
        </Route>

        <Route path="/" render={props => <Landing {...props} />} />
      </Switch>
    </Suspense>
  );
  //Landing
  //Resources
  //Post
  //Filter

  return cockpitBody;
};

export default Cockpit;
